import axios from "axios";

export default userApi = {
    fetchLogin: (username, password) => {
        axios.post("http://localhost:3001/login", {
            username: username,
            password: password,
        }).then((response) => {
            if (response.data.message) {
                console.log(response.data.message);
            } else {
                dispatch(setUser(response.data));
                history.push("/");
            }
        });
    }
}
